import React from 'react';
import { Link } from 'react-router-dom';

class HomePage extends React.Component {
  render() {
    const backgroundImageStyle = {
      backgroundImage: `url(${require('../assets/img/header.jpg')})`,
      backgroundSize: 'cover',
      backgroundPosition: 'center',
      minHeight: '100vh',
    };

    return (
      <div style={backgroundImageStyle}>
        {/* Render buttons in the middle */}
        <div className="container mt-5">
          <div className="row justify-content-center">
            <div className="col-md-3 text-center">
              {/* Use Link component to navigate to Level 1 page */}
              <Link to="/level1">
                <button className="btn btn-primary btn-lg mb-2">Basics of Stock market</button>
              </Link>
            </div>
            <div className="col-md-3 text-center">
                <Link to ="/level2">
              <button className="btn btn-secondary btn-lg mb-2">Fundamental Analysis</button>
              </Link>
            </div>
            <div className="col-md-3 text-center">
                <Link to ='/level3'>
              <button className="btn btn-success btn-lg mb-2">Level 3</button>
              </Link>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default HomePage;
